var tipuesearch = {"pages": [{'title': 'About', 'text': '倉儲連結： https://github.com/40923103/cd2022 \n 網站連結： https://40923103.github.io/cd2022/content/index.html \n 線上上課連結： https://teams.microsoft.com \xa0（需先註冊Ｍicrosoft帳號) \n', 'tags': '', 'url': 'About.html'}, {'title': 'note', 'text': '記錄過程中遇到的問題，下次遇到類似問題時就有個根據可以解決 \n \n', 'tags': '', 'url': 'note.html'}, {'title': 'tokens', 'text': '\n 到setting底下的developer setting設置一個沒有期限的token並且將下面選項都打勾 \n 之後會出現一串文字碼 \n \n 複製到這裡的config裡，儲存即完成 \n', 'tags': '', 'url': 'tokens.html'}, {'title': 'pull request', 'text': '\n 點選右上角fork \n \n 回到編輯的網站裡，複製下程式碼 \n \n 貼至小白窗上，h1更改為 h3 ，中間的地方新增 學號 \n 完成後儲存下來 檔名後面要記得加上html.txt \n \n 回到github裡，點選 Add file \xa0  Upload files \n \n 點選 choose files \n \n 選擇要上傳的檔案 \n \n 點選左下角的 commit change \n \n 點選 pull requests \xa0  new pull request \n \n', 'tags': '', 'url': 'pull request.html'}, {'title': '小組上傳', 'text': '27 Design Fundamentals\xa0 \n 對於工程設計約束和問題了解的越多，解決約束，越容易完成大量的設計。 \n 像是醫療儀器開發設計過程也使用了NX這類的工具來做設計。 \n 利用工具能讓物件生產時較為順利，避免掉較不合理的尺寸或配合上的問題。 \n \n \n \n \n \n   \n \n \n \n \n \n \n \n \n \n 28 NX Design Simulation FEM Example \n 利用NX畫出長柱體並且研究結構和材料 \n \n \n \n \n \n   \n \n \n \n \n \n \n \n \n \n 29 Intro Lecture \n 常見的幾何形狀探討設計公差，使用到的測量儀器 \n \n \n \n \n \n', 'tags': '', 'url': '小組上傳.html'}, {'title': 'Leo', 'text': '在小黑窗裡輸入 leo \n \n 之後在左上角file-open outline 開啟coofig裡的pelican \n \n \n 進入到此畫面 \n \n 更改blog內容 \n 學號、標題、網站網址和github帳號 \n \n 先儲存資料 之後local-blog右鍵按goto script \n 右邊粉色區域會出現一串英文字- pelican markdown -o blog -s local_publishconf.py \n \n 複製下來後再輸入到小黑窗裡即完成 \n', 'tags': '', 'url': 'Leo.html'}, {'title': 'leo放置wink', 'text': '將wink影片原始碼複製貼到Leo裡 \n 切記：一定要先將Wink影片字碼改為網址 \n \n 複製上去後，將紅色畫底線的地方刪除 \n \n 在第一行的地方新增字碼 \n <link rel="stylesheet" type="text/css" href="./../cmsimde/static/winkPlayer.css"></p> <script type="text/javascript" src="./../cmsimde/static/winkPlayer.js"></script><script>// <![CDATA[ \n \n 複製上去即完成 \n \n 字碼改成網址方法 \n \n 將<source src=後面的字碼刪除掉 \n \n 貼上網址後 \n \n 輸入這些文字，上傳到leo上就完成了 \n \n', 'tags': '', 'url': 'leo放置wink.html'}, {'title': '上課內容', 'text': '\n 記錄每周上課進度 \n', 'tags': '', 'url': '上課內容.html'}, {'title': 'W3', 'text': '製作小組報告內容，觀看影片並且抓出重點內容，使用wink錄製影片 \n \n \n', 'tags': '', 'url': 'W3.html'}, {'title': 'W5', 'text': '下載NX1980_cd2022 \n 至cd2022網站裡找到下載的網址 \n \n 下載完畢後解壓縮至電腦資料夾裡 \n', 'tags': '', 'url': 'W5.html'}, {'title': 'W6', 'text': 'Leo \n 在小黑窗裡打上leo \n 之後會跑出 \n \n 打開leo頁面後 \n \n 匯入cd2022裡config的資料夾的 pelican檔案 \n \n 進入到此畫面 \n \n 更改blog內容 \n 學號、標題、網站網址和github帳號 \n \n 先儲存資料 之後local-blog右鍵按goto script \n \n 右邊粉色區域會出現一串英文字- pelican markdown -o blog -s local_publishconf.py \n 複製下來後再輸入到小黑窗裡 \n __ \n 第一次上傳時老師那邊搜尋不到我的blog，因為slug後面沒有加.html \n \n', 'tags': '', 'url': 'W6.html'}, {'title': 'W7', 'text': '1.繪製出零件圖 匯入到coppeliasim裡 \n 我是使用Onshape並且參考youtube影片繪製四個零件並且組合起來放置到 Coppeliasim裡模擬 \n \n 零件圖片： \n \n \n \n \n \n \n   \n \n \n \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'W7.html'}, {'title': 'W8', 'text': '利用Onshape繪製組合圖側面的箱子，因為這個不能直接拆解會比較複雜，所以分配到這兩個小零件 \n \n 小組分配繪製零件，我的部分分配到減速箱上蓋和軸承支撐軸 \n \n \n 繪製完後以及匯入其他零件就可以開始組裝，但因過程太過繁雜，索性參考老師已組好的檔案 \n \n 之後再匯入到 CoppeliaSim \n \n 心得：在繪製零件的過程中其實有些許遇到困難，因為有些小細節以及量測問題都讓我頭很大，所幸後來還是有繪製出來。模擬的部分因為總共有153個零件，一開始想試著組裝，到後來眼睛真的快脫窗，所以走了一條捷徑，下載了老師的檔案去模擬，哎呀我真是不應該。 \n \n', 'tags': '', 'url': 'W8.html'}, {'title': 'W10', 'text': '心得：這個禮拜又複習了之前操作過的ssh，我覺得蠻有成就感的，因為終於有聽懂流程，順便更了解之前到底在做什麼，另外鮮少使用NX繪圖的我，也可以在老師錄製的wink影片裡摸熟一些步驟。 \n', 'tags': '', 'url': 'W10.html'}, {'title': 'w10_block_ui', 'text': '\n \n \n \n \n \n   \n \n \n \n \n \n \n \n \n \xa0 \n', 'tags': '', 'url': 'w10_block_ui.html'}, {'title': 'w10_nx_integ', 'text': '\xa0 \n \n \n \n \n   \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'w10_nx_integ.html'}, {'title': 'w10_ssh', 'text': '\xa0 \n \n \n \n   \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'w10_ssh.html'}, {'title': 'W11s1 ~W11s4', 'text': '將w8-w10上課內容以及分配工作上傳至小組倉儲 \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'W11s1 ~W11s4.html'}, {'title': 'W12', 'text': '本週透過上課時所給的程式碼，套用到NX程式裡，就可以跑出來顯示組合件裡的零件組和總重量。 所需的零件總共有155個。 \n \n \n \n \n', 'tags': '', 'url': 'W12.html'}, {'title': 'cadlab startup', 'text': '\n \n \n \n \n \n   \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'cadlab startup.html'}, {'title': 'NXOpen Python', 'text': '\n \n \n \n \n \n   \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'NXOpen Python.html'}, {'title': 'w12_graduate_school', 'text': '\n \n \n \n \n   \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'w12_graduate_school.html'}, {'title': 'W14', 'text': 'test \n \n', 'tags': '', 'url': 'W14.html'}, {'title': 'W16', 'text': '利用tkinter GUI介面slider控制uArm機械手臂 \n \n \n \n \n \n \n \n   \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'W16.html'}, {'title': 'midterm', 'text': '零件組工程圖 \n (工程圖) \n (工程圖): \n = https://cad.onshape.com/documents/40b19c6aa11669a1ac25b789/w/4dc1e5db16366400f9219c27/e/d8695880a885f568d0fb80b0?renderMode=0&uiState=6271cb6613691c271a9bdc00 \n \n', 'tags': '', 'url': 'midterm.html'}, {'title': '遠距上課', 'text': '先申辦好One drive帳號 \n \n \n 接續辦理Microsoft teams帳號 \n \n \n', 'tags': '', 'url': '遠距上課.html'}]};